import { Button, Text, ListItem, Image, View } from 'react-native-elements';

export default function MyListItem({ itemData, navigatorRef }) {

  return (    
    <ListItem>
      <View>
      <ListItem.Content>
          <Image source={{ uri: itemData.keyImage }} />
        <Text>{itemData.name}</Text>
      </ListItem.Content>

      <Button
        icon={{
          name: 'add-outline',
          type: 'ionicon',
          size: 15,
        }}
        iconPosition='center'
        disabled={!itemData.active}
        onPress={() => navigatorRef.navigate('ResortDetail', {
          detailId: itemData.id,
        })}
      />
      </View>
    </ListItem>
  );
}
